import React from 'react'
import './App.css';
import { FaPhotoVideo, FaBookReader, FaSistrix } from "react-icons/fa";
import data from './data.js';
import ImageCard from './ImageCard/ImageCard';


function App() {


  return(

    <div>
      <div className="container"> 
    <h1> PhotoGallery</h1>
    <FaSistrix/>  <input  type="text" name= "Search" placeholder="Search Anything "></input>
        <button type= "submit"  className="btn">Search </button>
      </div> 

      <div className="wrapper">
         <h1>Gallery</h1>
         {data.map(image => ( 
         <ImageCard 
         key={image.name}
         name= {image.name}
         />
         ))}

      </div>


  </div>

  )
}
// the <> creates a single elemnt, but when the code is compild it is not added to the final markup.
export default App;
